Под санкции ЕС также попали:

— Альфа-банк, "Открытие", банк "Россия" и Промсвязьбанк;

— Минобороны РФ, СВР, "Оборонпром" и "Рособоронэкспорт";

— РЖД, "Камаз", "Севкомфлот", "Севмаш";

— 60 ведущих компаний российского ВПК, самолетостроительных и кораблестроительных компаний.

Борис Джонсон сообщил о ряде санкций Британии против России: 

— блокировка ВТБ и "Аэрофлота";

— ограничения на суммы, которые россияне могут держать на счетах в Британии;

— закрывается экспорт высокотехнологичной продукции в РФ;

— отказ от российских нефти и газа.

Верховная Рада Украины поддержала указ президента о введении чрезвычайного положения на территории страны, за исключением Луганской и Донецкой областей. ЧП вводится с полуночи 24 февраля (1:00 по мск).

Степень мер будут определять региональные власти. Это значит, что при необходимости они могут ввести (а могут и не вводить): 

— запрет на массовые мероприятия;

— комендантский час;

— запрет на переезд для призывников, военнообязанных и резервистов;

— особый режим въезда и выезда из страны;

— запрет на работу аэропортов; 

— личные досмотры, ограничение движения машин, усиление охраны общественного порядка;

— временную и безвозвратную эвакуацию населения из опасных районов — с предоставлением жилья;

— запрет на распространение информации, которая дестабилизирует обстановку;

— особое регулирование связи и интернета, запрет на работу мобильных телефонов.
